import React, { Component } from 'react';

export default class LogoutComponent extends Component {
  constructor(props) {
    super(props);
  }

  render() {
    return (
      <div className="logout-component">
        <h1>You are logged out</h1>
        <div className="container">
          <p>Thank you for using me App</p>
        </div>
      </div>
    );
  }
}
